import React from 'react'

const PhotoListItems = (props) => {
    const {url, title, onClick} = props
    return(
        <li>
            <img src={url} />
            <h3>{title}</h3>
            <button onClick={onClick}>delete</button>
        </li>
    )
}

export default PhotoListItems
